//         <Netflix />    
//         <Tips/>
//         <h2><Counter /></h2>
//         <Pictures/>
//         </React.Fragment>
//     )
// }

// export default App

function add(num1, num2){
    return num1 + num2
}

function sub(num1, num2){
    return num1 > num2 ? num1 - num2 : num2 - num1
}

function mul(num1, num2){
    return num1 * num2
}
function div(num1, num2){
    return Math.round(num2 / num1) / (100^2)
}

export default add
export {sub, mul, div}
